//created by Whiplash99import java.io.*;import java.util.*;public class A{    public static void main(String[] args) throws IOException    {        BufferedReader br=new BufferedReader(new InputStreamReader(System.in));         int i,N;         String[] s=br.readLine().trim().split(" ");        N=Integer.parseInt(s[0]);        int M=Integer.parseInt(s[1]);         int[] a=new int[N];        s=br.readLine().trim().split(" ");        for(i=0;i<N;i++) a[i]=Integer.parseInt(s[i]);         if(N>M) //Pigeonhole Principle        {            System.out.println("YES");            System.exit(0);        }         boolean[][] dp=new boolean[N+1][M+1];        for(i=0;i<=N;i++) dp[i][0]=true;         for(i=1;i<=N;i++) //Subset-Sum DP        {            a[i-1]%=M;            for(int j=1;j<=M;j++)            {                if(a[i-1]==0) dp[i][j]=true;                 dp[i][j]|=dp[i-1][j];                if(a[i-1]>j) dp[i][j]|=dp[i-1][j-a[i-1]+M];                else dp[i][j]|=dp[i-1][j-a[i-1]];            }        }        System.out.println(dp[N][M]?"YES":"NO");    }}
